import {StyleSheet, Text, View, Button} from "react-native";
import {LinearGradient} from "expo-linear-gradient";

export default function App() {
  return (
    <View style={styles.container}>
        <LinearGradient colors={["#904e95", "#e96443"]} style={styles.linearGradient} start={[0.2,0]} end = {[0,1]} />
        <View style={styles.titleContainer}>
          <Text style={styles.titleText}>Beginners?</Text>
          <Text style={styles.text}>See what we can do for you.</Text>
        </View>
        <View style={styles.loginButtonSection}>
          <Button onPress={() => doLoginStuff()} 
                  style={styles.loginButton}
                  title="Login"
          />
        </View>

    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    fontFamily: "sf compact text",
  },

  titleContainer: {
    paddingLeft: "30px",
    paddingTop: "75px"

  },

  titleText: {
    color: "#fff",
    fontSize: "50px",
    fontWeight: "700",
    letterSpacing: "1px",
  },

  text: {
    color: "#fff",
    fontSize: "17px",
    marginTop: "2px"
  },

  loginButtonSection: {
    width: '100%',
    height: '30%',
    justifyContent: 'center',
    alignItems: 'center',
    flexDirection: "row", 
 },

 inputText: {
    marginLeft: '20%',
    width: '60%'
 },

 loginButton: {
   backgroundColor: 'blue',
   color: 'white'
 },


  linearGradient: {
    zIndex: -1,
    position: "absolute",
    left: 0,
    right: 0,
    top: 0,
    height: "100%"
  }

});
